import axios from 'axios';


const initLogin = (account, password) => {
  return {
    type: 'GET_LOGIN',
    account,
    password
  }
}

export const getLogin = (account, passoword) => {
  return (dispatch) => {
    dispatch(initLogin(account,passoword))
  }
}
